// src/components/UserGrid.js
import React from 'react';
import UserCard from './UserCard';
import './UserGrid.css';

const UserGrid = ({ users }) => {
  return (
    <div className="user-grid-container">
      {users.map(user => (
        <UserCard key={user.id} user={user} />
      ))}
    </div>
  );
};

export default UserGrid;
